import React, { useEffect, useState } from "react";
import axios from "axios";

const PendingApproval = () => {
  const [users, setUsers] = useState([]);
  const [selectedRoles, setSelectedRoles] = useState({});

  useEffect(() => {
    const fetchPendingUsers = async () => {
      try {
        const response = await axios.get("/api/users/pending", {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        });
        setUsers(response.data);
      } catch (err) {
        console.error("Error fetching users:", err);
      }
    };
    fetchPendingUsers();
  }, []);

  const handleApprove = async (userId) => {
    try {
      const role = selectedRoles[userId] || "staff";

      await axios.patch(
        `/api/approval/approve/${userId}`,
        { role },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        }
      );

      alert("User approved and email sent.");
      setUsers(users.filter((user) => user._id !== userId));
    } catch (err) {
      console.error("Approval error:", err);
      alert("Approval failed. Please check the server.");
    }
  };

  const handleReject = async (userId) => {
    try {
      await axios.patch(
        `/api/approval/reject/${userId}`,
        {},
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        }
      );

      alert("User rejected and email sent.");
      setUsers(users.filter((user) => user._id !== userId));
    } catch (err) {
      console.error("Rejection error:", err);
      alert("Rejection failed. Please check the server.");
    }
  };

  const handleRoleChange = (userId, role) => {
    setSelectedRoles((prev) => ({ ...prev, [userId]: role }));
  };

  return (
    <div className="container mt-5">
      <h2>ğŸš¦ Pending Approvals</h2>
      {users.length === 0 ? (
        <p>No pending users found.</p>
      ) : (
        <table className="table">
          <thead>
            <tr>
              <th>Email</th>
              <th>Phone</th>
              <th>Address</th>
              <th>Company</th>
              <th>Role</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user._id}>
                <td>{user.email}</td>
                <td>{user.phone}</td>
                <td>{user.address}</td>
                <td>{user.companyName || "â€”"}</td>
                <td>
                  <select
                    className="form-select"
                    value={selectedRoles[user._id] || "staff"}
                    onChange={(e) => handleRoleChange(user._id, e.target.value)}
                  >
                    <option value="staff">Staff</option>
                    <option value="external_company">External Company</option>
                  </select>
                </td>
                <td>
                  <button
                    className="btn btn-success me-2"
                    onClick={() => handleApprove(user._id)}
                  >
                    Approve
                  </button>
                  <button
                    className="btn btn-danger"
                    onClick={() => handleReject(user._id)}
                  >
                    Reject
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default PendingApproval;
